import 'bootstrap/dist/css/bootstrap.min.css';
import './Feed.css';
import Filter from './FIlter';
import User from './User';

let user = {
    name: "Talentbase",
    pic: "",
    userType: "startup",
    location: "Delhi",
    summary: "lorem epsumlorem epsumlorem epsumlorem epsumlorem epsumlorem epsum",
    AOI: []
}

class Feed extends Component {
    constructor(props){
        super(props)
        this.list = [{
            name: "Talentbase",
            pic: "",
            userType: "startup",
            location: "Delhi",
            summary: "lorem epsumlorem epsumlorem epsumlorem epsumlorem epsumlorem epsum",
