        },
        {
            name: "Talentbase",
            pic: "",
            userType: "startup",
            location: "Delhi",
            summary: "lorem epsumlorem epsumlorem epsumlorem epsumlorem epsumlorem epsum",
            AOI: ["startup"]
        },
        {
            name: "Talentbase",
            pic: "",
            userType: "startup",
            location: "Delhi",
            summary: "lorem epsumlorem epsumlorem epsumlorem epsumlorem epsumlorem epsum",
            AOI: ["startup"]
        },
        {
            name: "Investor",
            pic: "",
            userType: "investor",
            location: "Delhi",
            summary: "lorem epsumlorem epsumlorem epsumlorem epsumlorem epsumlorem epsum",
